import { Container } from 'react-bootstrap';
import { BrowserRouter as Router } from 'react-router' 
import Footer from './components/Footer';
import Header from './components/Header';
import HomeScreen from './screens/HomeScreen'; 

const App = () => {
  return (
    <Router>
      <Header />
      <main className="py-3">
        <Container>
          <HomeScreen/>
        </Container>
      </main>
      <Footer />
    </Router>

  );
};

export default App;
